import React from 'react';
import './Travel.css'
import { MapContainer, TileLayer, Polygon, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';


const Travel = () => {
  const indiaBounds = [
    [6, 68],  // Southwestern corner of India
    [36, 98]  // Northeastern corner of India
  ];

  const delhiCoords = [28.6139, 77.2090]; // Coordinates for Delhi

  return (
    <MapContainer
      style={{ width: '100%', height: '500px' }}
      bounds={indiaBounds}
      scrollWheelZoom={false}
    >
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      <Polygon
        positions={indiaBounds}
        color="blue"
        fillOpacity={0} // Transparent fill for the map outline
      />
      <Popup position={delhiCoords}>
        <div>
          <h3>Delhi</h3>
          <p>The capital city of India</p>
        </div>
      </Popup>
    </MapContainer>
  );
};


